INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('1', 'dx_substr', '参数：2个。列序号不需要填写，程序自动生成。“空”以“NULL”字符串表示。\r\n举例：\r\n[dx_substr]  [2|5]  column X的value为“dataxTest”=>\"taxTe\"; \r\n[dx_substr]  [5|10]  column X的value为“dataxTest”=>\"Test\"\r\n\r\n官方参数：3个, \r\n第一个参数：字段编号，对应record中第几个字段。\r\n第二个参数：字段值的开始位置。\r\n第三个参数：目标字段长度。\r\n返回：从字符串的指定位置（包含）截取指定长度的字符串。如果开始位置非法抛出异常。如果字段为空值，直接返回（即不参与本transformer）. \r\n举例：\r\ndx_substr(1,\"2\",\"5\")  column 1的value为“dataxTest”=>\"taxTe\"; \r\ndx_substr(1,\"5\",\"10\")  column 1的value为“dataxTest”=>\"Test\"', 2, '1', '1', '2018-7-18 16:26:44', '1', '2018-7-18 16:26:44');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('2', 'dx_pad', '参数：3个。列序号不需要填写，程序自动生成。“空”以“NULL”字符串表示。\r\n举例：\r\n[dx_pad]  [l4|A]  如果column X 的值为 xyz=> Axyz， 值为 xyzzzzz => xyzz; \r\n[dx_pad]  [r|4|A]  如果column X 的值为 xyz=> xyzA， 值为 xyzzzzz => xyzz\r\n\r\n官方参数：4个, \r\n第一个参数：字段编号，对应record中第几个字段。\r\n第二个参数：\"l\",\"r\", 指示是在头进行pad，还是尾进行pad。\r\n第三个参数：目标字段长度。\r\n第四个参数：需要pad的字符。\r\n返回： 如果源字符串长度小于目标字段长度，按照位置添加pad字符后返回。如果长于，直接截断（都截右边）。如果字段为空值，转换为空字符串进行pad，即最后的字符串全是需要pad的字符.\r\n举例：\r\ndx_pad(1,\"l\",\"4\",\"A\"), 如果column 1 的值为 xyz=> Axyz， 值为 xyzzzzz => xyzz; \r\ndx_pad(1,\"r\",\"4\",\"A\"), 如果column 1 的值为 xyz=> xyzA， 值为 xyzzzzz => xyzz', 3, '1', '1', '2018-7-18 16:38:45', '1', '2018-7-18 16:38:45');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('3', 'dx_replace', '参数：3个。列序号不需要填写，程序自动生成。“空”以“NULL”字符串表示。\r\n举例：\r\n[dx_replace]  [2|4|****]  column X的value为“dataxTest”=>\"da****est\";\r\n[dx_replace]  [5|10|****]  column X的value为“dataxTest”=>\"data****\"\r\n\r\n官方参数：4个,\r\n第一个参数：字段编号，对应record中第几个字段。\r\n第二个参数：字段值的开始位置。\r\n第三个参数：需要替换的字段长度。\r\n第四个参数：需要替换的字符串。\r\n返回： 从字符串的指定位置（包含）替换指定长度的字符串。如果开始位置非法抛出异常。如果字段为空值，直接返回（即不参与本transformer）\r\n举例：\r\ndx_replace(1,\"2\",\"4\",\"****\")  column 1的value为“dataxTest”=>\"da****est\";\r\ndx_replace(1,\"5\",\"10\",\"****\")  column 1的value为“dataxTest”=>\"data****\"', 3, '1', '1', '2018-7-18 16:46:26', '1', '2018-7-18 16:46:26');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('4', 'dx_filter', '参数：2个。列序号不需要填写，程序自动生成。“空”以“NULL”字符串表示。\r\n举例：\r\n[dx_filter]  [like|dataTest] \r\n[dx_filter]  [>=|10]\r\n\r\n官方参数：3个,\r\n第一个参数：字段编号，对应record中第几个字段。\r\n第二个参数：运算符，支持一下运算符：like, not like, >, =, <, >=, !=, <=\r\n第三个参数：正则表达式（java正则表达式）、值。\r\n返回：\r\n(1). 如果匹配正则表达式，返回Null，表示过滤该行。不匹配表达式时，表示保留该行。（注意是该行）。对于>=<都是对字段直接compare的结果.\r\n(2). like, not like是将字段转换成String，然后和目标正则表达式进行全匹配。(, =, <, >=, !=, <= 对于DoubleColumn比较double值，对于LongColumn和DateColumn比较long值，其他StringColumn，BooleanColumn以及ByteColumn均比较的是StringColumn值。)\r\n(3). 如果目标colunn为空（null）,对于 = null的过滤条件，将满足条件，被过滤。！=null的过滤条件，null不满足过滤条件，不被过滤。 like，字段为null不满足条件，不被过滤，和not like，字段为null满足条件，被过滤。\r\n举例：\r\ndx_filter(1,\"like\",\"dataTest\")  \r\ndx_filter(1,\">=\",\"10\")  \r\n注意：（关联filter暂不支持，即多个字段的联合判断，函参太过复杂，用户难以使用。）', 2, '1', '1', '2018-7-18 16:51:44', '1', '2018-7-18 16:51:44');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('5', 'dx_groovy', '参数：2个。第二个参数是一个String类型的List(可以为空)，List元素之间以英文逗号分隔。“空”以“NULL”字符串表示。\r\n举例：\r\n[dx_groovy]  [//groovy code//|import somePackage1;,import somePackage2;] \r\n\r\n官方参数：2个,\r\n第一个参数： groovy code\r\n第二个参数（列表或者为空）：extraPackage\r\n备注：\r\ndx_groovy只能调用一次。不能多次调用。\r\ngroovy code中支持java.lang, java.util的包，可直接引用的对象有record，以及element下的各种column（BoolColumn.class,BytesColumn.class,DateColumn.class,DoubleColumn.class,LongColumn.class,StringColumn.class）。不支持其他包，如果用户有需要用到其他包，可设置extraPackage，注意extraPackage不支持第三方jar包。\r\ngroovy code中，返回更新过的Record（比如record.setColumn(columnIndex, new StringColumn(newValue));），或者null。返回null表示过滤此行。\r\n用户可以直接调用静态的Util方式（GroovyTransformerStaticUtil），目前GroovyTransformerStaticUtil的方法列表 (按需补充)：\r\n举例:\r\ngroovy 实现的subStr:\r\n        String code = \"Column column = record.getColumn(1);\\n\" +\r\n                \" String oriValue = column.asString();\\n\" +\r\n                \" String newValue = oriValue.substring(0, 3);\\n\" +\r\n                \" record.setColumn(1, new StringColumn(newValue));\\n\" +\r\n                \" return record;\";\r\n        dx_groovy(record);\r\ngroovy 实现的Replace:\r\nString code2 = \"Column column = record.getColumn(1);\\n\" +\r\n                \" String oriValue = column.asString();\\n\" +\r\n                \" String newValue = \\\"****\\\" + oriValue.substring(3, oriValue.length());\\n\" +\r\n                \" record.setColumn(1, new StringColumn(newValue));\\n\" +\r\n                \" return record;\";', 2, '1', '1', '2018-7-18 17:04:14', '1', '2018-7-18 17:04:14');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('6', 'dx_longdateformat', '参数：1个。列序号不需要填写，程序自动生成。“空”以“NULL”字符串表示。\r\n举例：\r\n[dx_longdateformat]  [yyyy-MM-dd HH:mm:ss]  column X的value为“1531982071481”=>\"2018-07-19 14:34:31\"; \r\n[dx_longdateformat]  [yyyy-MM-dd]  column X的value为“1531982071481”=>\"2018-07-19\"\r\n\r\n官方参数：2个, \r\n第一个参数：字段编号，对应record中第几个字段。\r\n第二个参数：日期long字段转成字符串的pattern, 如“yyyy-MM-dd HH:mm:ss”。\r\n返回：日期字符串。如果开始位置非法抛出异常。如果字段为空值，直接返回（即不参与本transformer）. \r\n举例：\r\ndx_longdateformat(1,\"yyyy-MM-dd HH:mm:ss\")  column 1的value为“1531982071481”=>\"2018-07-19 14:34:31\"; \r\ndx_longdateformat(1,\"yyyy-MM-dd\")  column 1的value为“1531982071481”=>\"2018-07-19\"', 1, '1', '1', '2018-7-19 14:25:26', '1', '2018-7-19 14:25:26');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('7', 'dx_dic', '参数：1个。列序号不需要填写，程序自动生成。“空”以“NULL”字符串表示。\r\n举例：\r\n[dx_dic]  [sex]  column X的value为“1”=>\"男\"; \r\n[dx_dic]  [nation]  column X的value为“1”=>\"男\"; \r\n\r\n官方参数：2个, \r\n第一个参数：字段编号，对应record中第几个字段。\r\n第二个参数：数据字典名称，对应的数据连接器数据库表“t_dic”中的“fcode”字段。\r\n返回：对应字典值。如果开始位置非法抛出异常。如果字段为空值，直接返回（即不参与本transformer）. \r\n举例：\r\ndx_dic(1,\"sex\")  column 1的value为“1”=>\"男\"; \r\ndx_dic(1,\"nation\")  column 1的value为“001”=>\"汉族\"', 1, '1', '1', '2018-7-19 14:36:40', '1', '2018-7-19 14:36:40');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('8', 'dx_idcardformat', '参数：0个。列序号不需要填写，程序自动生成。\r\n举例：\r\n[dx_idcardformat]  column X的value为“2232332730204301”=>\"2232332197302043019\"; \r\n[dx_idcardformat]  column X的value为“232332199402142144”=>\"232332199402142144\"\r\n[dx_idcardformat]  column X的value为“1234567”=>\"1234567\"\r\n\r\n官方参数：1个, \r\n第一个参数：字段编号，对应record中第几个字段。\r\n返回：格式化后的身份证。如果开始位置非法抛出异常。如果字段为空值，直接返回（即不参与本transformer）. \r\n举例：\r\ndx_idcardformat(1)  column 1的value为“2232332730204301”=>\"2232332197302043019\"; \r\ndx_idcardformat(1)  column 1的value为“232332199402142144”=>\"232332199402142144\";\r\ndx_idcardformat(1)  column 1的value为“1234567”=>\"1234567\"', 0, '1', '1', '2018-8-13 16:58:34', '1', '2018-8-13 16:58:37');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('9', 'dx_nullformat', '参数：1个。列序号不需要填写，程序自动生成。\r\n举例：\r\n[dx_nullformat]  [NULL]  column X的value为“”或null => \"NULL\"; \r\n[dx_nullformat]  [N/A]  column X的value为“”或null => \"N/A\"\r\n\r\n官方参数：2个, \r\n第一个参数：字段编号，对应record中第几个字段。\r\n第二个参数：“空”字段转成替代的字符串, 如“NULL”。\r\n返回：替换后的字符串。如果开始位置非法抛出异常。\r\n举例：\r\ndx_nullformat(1,\"NULL\")  column 1的value为null或\"\" => \"NULL\"; \r\ndx_nullformat(1,\"N/A\")  column 1的value为null或\"\" => \"N/A\"', 1, '1', '1', '2018-8-13 17:05:01', '1', '2018-8-13 17:05:04');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('10', 'dx_tyidjsonformat', '参数：1个。列序号不需要填写，程序自动生成。\n举例：\n[dx_tyidjsonformat]  [ty001]  column X的value为“320106197403302426”=>{\"id\":\"ty001\", \"key\":\"320106197403302426\"}; \n[dx_tyidjsonformat]  [ty008]  column X的value为“苏JAY888”=> {\"id\":\"ty008\", \"key\":\"苏JAY888\"}\n\n官方参数：2个, \n第一个参数：字段编号，对应record中第几个字段。\n第二个参数：tyid编号。\n返回：符合tyid固定格式的json字符串。如果字段为空值，直接返回（即不参与本transformer）. \n举例：\ndx_tyidjsonformat(1,\"ty001\")  column 1的value为“320106197403302426”=>{\"id\":\"ty001\", \"key\":\"320106197403302426\"}; \ndx_tyidjsonformat(1,\"ty008\")  column 1的value为“苏JAY888”=>{\"id\":\"ty008\", \"key\":\"苏JAY888\"}', 1, '1', '1', '2018-8-24 16:04:33', '1', '2018-8-24 16:04:33');
INSERT INTO t_function (FID, FNAME, FDESC, FPARAMSIZE, FIS_SYSTEM, FCREATER, FCREATE_DATE, FMODIFIER, FMODIFY_DATE) VALUES ('11', 'dx_replacestr', '参数：2个。列序号不需要填写，程序自动生成。\n举例：\n[dx_replacestr]  [人民   ****]  column X的value为“非洲人民在哪里”=>\"非洲在哪里\"\n[dx_replacestr]  [DD  ]  column X的value为“DataxDD”=>\"Datax\"\n[dx_replacestr]  [AA|BB|CC   ****]  column X的value为“DataxAAisBBnotCCMM”=>\"Datax****is****not****MM\"\n\n官方参数：3个,\n第一个参数：字段编号，对应record中第几个字段。\n第二个参数：需要替换的字符串，支持以英文竖线分割，此时会按竖线切分，分别替换目标字符串。\n第三个参数：需要替换的字符串。\n返回： 将目标字符串按照指定的格式替换成指定的字符串。如果字段为空值，直接返回（即不参与本transformer）\n举例：\ndx_replacestr(1,\"人民\",\"****\")  column 1的value为“非洲人民在哪里”=>\"非洲在哪里\";\ndx_replacestr(1,\"DD\",\"\")  column 1的value为“DataxDD”=>\"Datax\";\ndx_replacestr(1,\"AA|BB|CC\",\"****\")  column 1的value为“DataxAAisBBnotCCMM”=>\"Datax****is****not****MM\"', 2, '1', '1', '2018-8-24 16:13:40', '1', '2018-8-24 16:13:40');
